import Layout from '../components/Layout';
import Login from '../components/Login';
import Logout from '../components/Logout';


const login = () =>  {


   return  (
    <Layout>
        <Logout></Logout>
        <Login></Login>

        
    
    </Layout>

    );
};




export default login;
